function Login() {
  return (
    <div>
        <h1 className='heading'>Login Page</h1>

        <input type='text' name='username' className='uname' placeholder='Username'/><br/>
        <input type='password' name='pssd' className='pswd' placeholder='Password'/>
        <button>Login</button>


    </div>
  )
}

export default Login
